def getALl():
    f = open('ingred.json', 'w')
    f.write('[')
    count = 0
    for i in asd:
        res = requests.get(i)
        soup = BeautifulSoup(res.text,'html.parser')
        for j in soup.select('#calories-table > tbody > tr'):
            z = {}
            z['name'] = j.select('a')[0].text
            z['serving'] = j.select('td.serving.portion')[0].text
            z['calories'] = j.select('td.kcal > data')[0].text
            # print(j.select('td.kcal > data')[0].text)
            # print('\n\n')
            # break
            json.dump(z,f,indent=4)
            f.write(',\n')
            count = count +1
            print(count)
    f.write(']')
    f.close()
def getALLL():
    final = []
    f = open('ingred.json', 'w')
    f.write('[')
    # count = 0
    for i in asd:
        res = requests.get(i)
        soup = BeautifulSoup(res.text,'html.parser')
        for j in soup.select('#calories-table > tbody > tr'):
            z = {}
            z['name'] = j.select('a')[0].text
            serv = j.select('td.serving.portion')[0].text.strip().split(' ')
            num = serv[0]
            if '/' in num:
                num = float(int(num[0]) / int(num[-1]))
            else:
                num = float(num)
            z['serving'] = ' '.join(serv[1:-1]).split('\xa0')[0]
            z['amount'] = round(float(' '.join(serv[-2:]).split('(')[-1].split(' ')[0]) / num,2)
            z['unit'] = ' '.join(serv[-2:]).split('(')[-1].split(' ')[-1][0:-1]
            z['calories'] = int(float(j.select('td.kcal > data')[0].text) * z['amount']/100)
        # print(z)
        # print('\n\n')
        # break
            final.append(z)
            print(len(final))
            # print(z['name'])
    final = sorted(final, key = lambda x: len(x['name']), reverse=True)
    print(final)
    for i in final:
        json.dump(i,f,indent=4)
        f.write(',\n')
    f.write(']')
    f.close()
